hebsuperobject.biblemap.put("b2_4_31", new hebsuperobject(2,4,31,"ויאמן העם וישמעו כי פקד יהוה את בני ישראל וכי ראה את ענים ויקדו וישתחוו׃"));
hebsuperobject.biblemap.put("b2_5_1", new hebsuperobject(2,5,1,"ואחר באו משה ואהרן ויאמרו אל פרעה כה אמר יהוה אלהי ישראל שלח את עמי ויחגו לי במדבר׃"));
