hebsuperobject.biblemap.put("b2_10_5", new hebsuperobject(2,10,5,"וכסה את עין הארץ ולא יוכל לראת את הארץ ואכל את יתר הפלטה הנשארת לכם מן הברד ואכל את כל העץ הצמח לכם מן השדה׃"));
hebsuperobject.biblemap.put("b2_10_6", new hebsuperobject(2,10,6,"ומלאו בתיך ובתי כל עבדיך ובתי כל מצרים אשר לא ראו אבתיך ואבות אבתיך מיום היותם על האדמה עד היום הזה ויפן ויצא מעם פרעה׃"));
hebsuperobject.biblemap.put("b2_10_7", new hebsuperobject(2,10,7,"ויאמרו עבדי פרעה אליו עד מתי יהיה זה לנו למוקש שלח את האנשים ויעבדו את יהוה אלהיהם הטרם תדע כי אבדה מצרים׃"));
hebsuperobject.biblemap.put("b2_10_8", new hebsuperobject(2,10,8,"ויושב את משה ואת אהרן אל פרעה ויאמר אלהם לכו עבדו את יהוה אלהיכם מי ומי ההלכים׃"));
hebsuperobject.biblemap.put("b2_10_9", new hebsuperobject(2,10,9,"ויאמר משה בנערינו ובזקנינו נלך בבנינו ובבנותנו בצאננו ובבקרנו נלך כי חג יהוה לנו׃"));
hebsuperobject.biblemap.put("b2_10_10", new hebsuperobject(2,10,10,"ויאמר אלהם יהי כן יהוה עמכם כאשר אשלח אתכם ואת טפכם ראו כי רעה נגד פניכם׃"));
hebsuperobject.biblemap.put("b2_10_11", new hebsuperobject(2,10,11,"לא כן לכו נא הגברים ועבדו את יהוה כי אתה אתם מבקשים ויגרש אתם מאת פני פרעה׃"));
hebsuperobject.biblemap.put("b2_10_12", new hebsuperobject(2,10,12,"ויאמר יהוה אל משה נטה ידך על ארץ מצרים בארבה ויעל על ארץ מצרים ויאכל את כל עשב הארץ את כל אשר השאיר הברד׃"));
hebsuperobject.biblemap.put("b2_10_13", new hebsuperobject(2,10,13,"ויט משה את מטהו על ארץ מצרים ויהוה נהג רוח קדים בארץ כל היום ההוא וכל הלילה הבקר היה ורוח הקדים נשא את הארבה׃"));
hebsuperobject.biblemap.put("b2_10_14", new hebsuperobject(2,10,14,"ויעל הארבה על כל ארץ מצרים וינח בכל גבול מצרים כבד מאד לפניו לא היה כן ארבה כמהו ואחריו לא יהיה כן׃"));
hebsuperobject.biblemap.put("b2_10_15", new hebsuperobject(2,10,15,"ויכס את עין כל הארץ ותחשך הארץ ויאכל את כל עשב הארץ ואת כל פרי העץ אשר הותיר הברד ולא נותר כל ירק בעץ ובעשב השדה בכל ארץ מצרים׃"));
hebsuperobject.biblemap.put("b2_10_16", new hebsuperobject(2,10,16,"וימהר פרעה לקרא למשה ולאהרן ויאמר חטאתי ליהוה אלהיכם ולכם׃"));
hebsuperobject.biblemap.put("b2_10_17", new hebsuperobject(2,10,17,"ועתה שא נא חטאתי אך הפעם והעתירו ליהוה אלהיכם ויסר מעלי רק את המות הזה׃"));
hebsuperobject.biblemap.put("b2_10_18", new hebsuperobject(2,10,18,"ויצא מעם פרעה ויעתר אל יהוה׃"));
hebsuperobject.biblemap.put("b2_10_19", new hebsuperobject(2,10,19,"ויהפך יהוה רוח ים חזק מאד וישא את הארבה ויתקעהו ימה סוף לא נשאר ארבה אחד בכל גבול מצרים׃"));
hebsuperobject.biblemap.put("b2_10_20", new hebsuperobject(2,10,20,"ויחזק יהוה את לב פרעה ולא שלח את בני ישראל׃"));
hebsuperobject.biblemap.put("b2_10_21", new hebsuperobject(2,10,21,"ויאמר יהוה אל משה נטה ידך על השמים ויהי חשך על ארץ מצרים וימש חשך׃"));
hebsuperobject.biblemap.put("b2_10_22", new hebsuperobject(2,10,22,"ויט משה את ידו על השמים ויהי חשך אפלה בכל ארץ מצרים שלשת ימים׃"));
hebsuperobject.biblemap.put("b2_10_23", new hebsuperobject(2,10,23,"לא ראו איש את אחיו ולא קמו איש מתחתיו שלשת ימים ולכל בני ישראל היה אור במושבתם׃"));
hebsuperobject.biblemap.put("b2_10_24", new hebsuperobject(2,10,24,"ויקרא פרעה אל משה ויאמר לכו עבדו את יהוה רק צאנכם ובקרכם יצג גם טפכם ילך עמכם׃"));
hebsuperobject.biblemap.put("b2_10_25", new hebsuperobject(2,10,25,"ויאמר משה גם אתה תתן בידנו זבחים ועלות ועשינו ליהוה אלהינו׃"));
hebsuperobject.biblemap.put("b2_10_26", new hebsuperobject(2,10,26,"וגם מקננו ילך עמנו לא תשאר פרסה כי ממנו נקח לעבד את יהוה אלהינו ואנחנו לא נדע מה נעבד את יהוה עד באנו שמה׃"));
hebsuperobject.biblemap.put("b2_10_27", new hebsuperobject(2,10,27,"ויחזק יהוה את לב פרעה ולא אבה לשלחם׃"));
hebsuperobject.biblemap.put("b2_10_28", new hebsuperobject(2,10,28,"ויאמר לו פרעה לך מעלי השמר לך אל תסף ראות פני כי ביום ראתך פני תמות׃"));
hebsuperobject.biblemap.put("b2_10_29", new hebsuperobject(2,10,29,"ויאמר משה כן דברת לא אסף עוד ראות פניך׃"));
hebsuperobject.biblemap.put("b2_11_1", new hebsuperobject(2,11,1,"ויאמר יהוה אל משה עוד נגע אחד אביא על פרעה ועל מצרים אחרי כן ישלח אתכם מזה כשלחו כלה גרש יגרש אתכם מזה׃"));
hebsuperobject.biblemap.put("b2_11_2", new hebsuperobject(2,11,2,"דבר נא באזני העם וישאלו איש מאת רעהו ואשה מאת רעותה כלי כסף וכלי זהב׃"));
hebsuperobject.biblemap.put("b2_11_3", new hebsuperobject(2,11,3,"ויתן יהוה את חן העם בעיני מצרים גם האיש משה גדול מאד בארץ מצרים בעיני עבדי פרעה ובעיני העם׃"));
hebsuperobject.biblemap.put("b2_11_4", new hebsuperobject(2,11,4,"ויאמר משה כה אמר יהוה כחצת הלילה אני יוצא בתוך מצרים׃"));
hebsuperobject.biblemap.put("b2_11_5", new hebsuperobject(2,11,5,"ומת כל בכור בארץ מצרים מבכור פרעה הישב על כסאו עד בכור השפחה אשר אחר הרחים וכל בכור בהמה׃"));
hebsuperobject.biblemap.put("b2_11_6", new hebsuperobject(2,11,6,"והיתה צעקה גדלה בכל ארץ מצרים אשר כמהו לא נהיתה וכמהו לא תסף׃"));
hebsuperobject.biblemap.put("b2_11_7", new hebsuperobject(2,11,7,"ולכל בני ישראל לא יחרץ כלב לשנו למאיש ועד בהמה למען תדעון אשר יפלה יהוה בין מצרים ובין ישראל׃"));
hebsuperobject.biblemap.put("b2_11_8", new hebsuperobject(2,11,8,"וירדו כל עבדיך אלה אלי והשתחוו לי לאמר צא אתה וכל העם אשר ברגליך ואחרי כן אצא ויצא מעם פרעה בחרי אף׃"));
hebsuperobject.biblemap.put("b2_11_9", new hebsuperobject(2,11,9,"ויאמר יהוה אל משה לא ישמע אליכם פרעה למען רבות מופתי בארץ מצרים׃"));
hebsuperobject.biblemap.put("b2_11_10", new hebsuperobject(2,11,10,"ומשה ואהרן עשו את כל המפתים האלה לפני פרעה ויחזק יהוה את לב פרעה ולא שלח את בני ישראל מארצו׃"));
hebsuperobject.biblemap.put("b2_12_1", new hebsuperobject(2,12,1,"ויאמר יהוה אל משה ואל אהרן בארץ מצרים לאמר׃"));
hebsuperobject.biblemap.put("b2_12_2", new hebsuperobject(2,12,2,"החדש הזה לכם ראש חדשים ראשון הוא לכם לחדשי השנה׃"));
hebsuperobject.biblemap.put("b2_12_3", new hebsuperobject(2,12,3,"דברו אל כל עדת ישראל לאמר בעשר לחדש הזה ויקחו להם איש שה לבית אבת שה לבית׃"));
hebsuperobject.biblemap.put("b2_12_4", new hebsuperobject(2,12,4,"ואם ימעט הבית מהית משה ולקח הוא ושכנו הקרב אל ביתו במכסת נפשת איש לפי אכלו תכסו על השה׃"));
hebsuperobject.biblemap.put("b2_12_5", new hebsuperobject(2,12,5,"שה תמים זכר בן שנה יהיה לכם מן הכבשים ומן העזים תקחו׃"));
hebsuperobject.biblemap.put("b2_12_6", new hebsuperobject(2,12,6,"והיה לכם למשמרת עד ארבעה עשר יום לחדש הזה ושחטו אתו כל קהל עדת ישראל בין הערבים׃"));
hebsuperobject.biblemap.put("b2_12_7", new hebsuperobject(2,12,7,"ולקחו מן הדם ונתנו על שתי המזוזת ועל המשקוף על הבתים אשר יאכלו אתו בהם׃"));
hebsuperobject.biblemap.put("b2_12_8", new hebsuperobject(2,12,8,"ואכלו את הבשר בלילה הזה צלי אש ומצות על מררים יאכלהו׃"));
hebsuperobject.biblemap.put("b2_12_9", new hebsuperobject(2,12,9,"אל תאכלו ממנו נא ובשל מבשל במים כי אם צלי אש ראשו על כרעיו ועל קרבו׃"));
hebsuperobject.biblemap.put("b2_12_10", new hebsuperobject(2,12,10,"ולא תותירו ממנו עד בקר והנתר ממנו עד בקר באש תשרפו׃"));
hebsuperobject.biblemap.put("b2_12_11", new hebsuperobject(2,12,11,"וככה תאכלו אתו מתניכם חגרים נעליכם ברגליכם ומקלכם בידכם ואכלתם אתו בחפזון פסח הוא ליהוה׃"));
hebsuperobject.biblemap.put("b2_12_12", new hebsuperobject(2,12,12,"ועברתי בארץ מצרים בלילה הזה והכיתי כל בכור בארץ מצרים מאדם ועד בהמה ובכל אלהי מצרים אעשה שפטים אני יהוה׃"));
hebsuperobject.biblemap.put("b2_12_13", new hebsuperobject(2,12,13,"והיה הדם לכם לאת על הבתים אשר אתם שם וראיתי את הדם ופסחתי עלכם ולא יהיה בכם נגף למשחית בהכתי בארץ מצרים׃"));
hebsuperobject.biblemap.put("b2_12_14", new hebsuperobject(2,12,14,"והיה היום הזה לכם לזכרון וחגתם אתו חג ליהוה לדרתיכם חקת עולם תחגהו׃"));
hebsuperobject.biblemap.put("b2_12_15", new hebsuperobject(2,12,15,"שבעת ימים מצות תאכלו אך ביום הראשון תשביתו שאר מבתיכם כי כל אכל חמץ ונכרתה הנפש ההוא מישראל מיום הראשן עד יום השבעי׃"));
hebsuperobject.biblemap.put("b2_12_16", new hebsuperobject(2,12,16,"וביום הראשון מקרא קדש וביום השביעי מקרא קדש יהיה לכם כל מלאכה לא יעשה בהם אך אשר יאכל לכל נפש הוא לבדו יעשה לכם׃"));
hebsuperobject.biblemap.put("b2_12_17", new hebsuperobject(2,12,17,"ושמרתם את המצות כי בעצם היום הזה הוצאתי את צבאותיכם מארץ מצרים ושמרתם את היום הזה לדרתיכם חקת עולם׃"));
hebsuperobject.biblemap.put("b2_12_18", new hebsuperobject(2,12,18,"בראשן בארבעה עשר יום לחדש בערב תאכלו מצת עד יום האחד ועשרים לחדש בערב׃"));
hebsuperobject.biblemap.put("b2_12_19", new hebsuperobject(2,12,19,"שבעת ימים שאר לא ימצא בבתיכם כי כל אכל מחמצת ונכרתה הנפש ההוא מעדת ישראל בגר ובאזרח הארץ׃"));
hebsuperobject.biblemap.put("b2_12_20", new hebsuperobject(2,12,20,"כל מחמצת לא תאכלו בכל מושבתיכם תאכלו מצות׃"));
hebsuperobject.biblemap.put("b2_12_21", new hebsuperobject(2,12,21,"ויקרא משה לכל זקני ישראל ויאמר אלהם משכו וקחו לכם צאן למשפחתיכם ושחטו הפסח׃"));
hebsuperobject.biblemap.put("b2_12_22", new hebsuperobject(2,12,22,"ולקחתם אגדת אזוב וטבלתם בדם אשר בסף והגעתם אל המשקוף ואל שתי המזוזת מן הדם אשר בסף ואתם לא תצאו איש מפתח ביתו עד בקר׃"));
hebsuperobject.biblemap.put("b2_12_23", new hebsuperobject(2,12,23,"ועבר יהוה לנגף את מצרים וראה את הדם על המשקוף ועל שתי המזוזת ופסח יהוה על הפתח ולא יתן המשחית לבא אל בתיכם לנגף׃"));
hebsuperobject.biblemap.put("b2_12_24", new hebsuperobject(2,12,24,"ושמרתם את הדבר הזה לחק לך ולבניך עד עולם׃"));
hebsuperobject.biblemap.put("b2_12_25", new hebsuperobject(2,12,25,"והיה כי תבאו אל הארץ אשר יתן יהוה לכם כאשר דבר ושמרתם את העבדה הזאת׃"));
hebsuperobject.biblemap.put("b2_12_26", new hebsuperobject(2,12,26,"והיה כי יאמרו אליכם בניכם מה העבדה הזאת לכם׃"));
hebsuperobject.biblemap.put("b2_12_27", new hebsuperobject(2,12,27,"ואמרתם זבח פסח הוא ליהוה אשר פסח על בתי בני ישראל במצרים בנגפו את מצרים ואת בתינו הציל ויקד העם וישתחוו׃"));
hebsuperobject.biblemap.put("b2_12_28", new hebsuperobject(2,12,28,"וילכו ויעשו בני ישראל כאשר צוה יהוה את משה ואהרן כן עשו׃"));
hebsuperobject.biblemap.put("b2_12_29", new hebsuperobject(2,12,29,"ויהי בחצי הלילה ויהוה הכה כל בכור בארץ מצרים מבכר פרעה הישב על כסאו עד בכור השבי אשר בבית הבור וכל בכור בהמה׃"));
hebsuperobject.biblemap.put("b2_12_30", new hebsuperobject(2,12,30,"ויקם פרעה לילה הוא וכל עבדיו וכל מצרים ותהי צעקה גדלה במצרים כי אין בית אשר אין שם מת׃"));
hebsuperobject.biblemap.put("b2_12_31", new hebsuperobject(2,12,31,"ויקרא למשה ולאהרן לילה ויאמר קומו צאו מתוך עמי גם אתם גם בני ישראל ולכו עבדו את יהוה כדברכם׃"));
hebsuperobject.biblemap.put("b2_12_32", new hebsuperobject(2,12,32,"גם צאנכם גם בקרכם קחו כאשר דברתם ולכו וברכתם גם אתי׃"));
hebsuperobject.biblemap.put("b2_12_33", new hebsuperobject(2,12,33,"ותחזק מצרים על העם למהר לשלחם מן הארץ כי אמרו כלנו מתים׃"));
hebsuperobject.biblemap.put("b2_12_34", new hebsuperobject(2,12,34,"וישא העם את בצקו טרם יחמץ משארתם צררת בשמלתם על שכמם׃"));
hebsuperobject.biblemap.put("b2_12_35", new hebsuperobject(2,12,35,"ובני ישראל עשו כדבר משה וישאלו ממצרים כלי כסף וכלי זהב ושמלת׃"));
hebsuperobject.biblemap.put("b2_12_36", new hebsuperobject(2,12,36,"ויהוה נתן את חן העם בעיני מצרים וישאלום וינצלו את מצרים׃"));
hebsuperobject.biblemap.put("b2_12_37", new hebsuperobject(2,12,37,"ויסעו בני ישראל מרעמסס סכתה כשש מאות אלף רגלי הגברים לבד מטף׃"));
hebsuperobject.biblemap.put("b2_12_38", new hebsuperobject(2,12,38,"וגם ערב רב עלה אתם וצאן ובקר מקנה כבד מאד׃"));
hebsuperobject.biblemap.put("b2_12_39", new hebsuperobject(2,12,39,"ויאפו את הבצק אשר הוציאו ממצרים עגת מצות כי לא חמץ כי גרשו ממצרים ולא יכלו להתמהמה וגם צדה לא עשו להם׃"));
hebsuperobject.biblemap.put("b2_12_40", new hebsuperobject(2,12,40,"ומושב בני ישראל אשר ישבו במצרים שלשים שנה וארבע מאות שנה׃"));
hebsuperobject.biblemap.put("b2_12_41", new hebsuperobject(2,12,41,"ויהי מקץ שלשים שנה וארבע מאות שנה ויהי בעצם היום הזה יצאו כל צבאות יהוה מארץ מצרים׃"));
hebsuperobject.biblemap.put("b2_12_42", new hebsuperobject(2,12,42,"ליל שמרים הוא ליהוה להוציאם מארץ מצרים הוא הלילה הזה ליהוה שמרים לכל בני ישראל לדרתם׃"));
hebsuperobject.biblemap.put("b2_12_43", new hebsuperobject(2,12,43,"ויאמר יהוה אל משה ואהרן זאת חקת הפסח כל בן נכר לא יאכל בו׃"));
hebsuperobject.biblemap.put("b2_12_44", new hebsuperobject(2,12,44,"וכל עבד איש מקנת כסף ומלתה אתו אז יאכל בו׃"));
hebsuperobject.biblemap.put("b2_12_45", new hebsuperobject(2,12,45,"תושב ושכיר לא יאכל בו׃"));
hebsuperobject.biblemap.put("b2_12_46", new hebsuperobject(2,12,46,"בבית אחד יאכל לא תוציא מן הבית מן הבשר חוצה ועצם לא תשברו בו׃"));
