hebsuperobject.biblemap.put("b2_19_3", new hebsuperobject(2,19,3,"ומשה עלה אל האלהים ויקרא אליו יהוה מן ההר לאמר כה תאמר לבית יעקב ותגיד לבני ישראל׃"));
hebsuperobject.biblemap.put("b2_19_4", new hebsuperobject(2,19,4,"אתם ראיתם אשר עשיתי למצרים ואשא אתכם על כנפי נשרים ואבא אתכם אלי׃"));
hebsuperobject.biblemap.put("b2_19_5", new hebsuperobject(2,19,5,"ועתה אם שמוע תשמעו בקלי ושמרתם את בריתי והייתם לי סגלה מכל העמים כי לי כל הארץ׃"));
hebsuperobject.biblemap.put("b2_19_6", new hebsuperobject(2,19,6,"ואתם תהיו לי ממלכת כהנים וגוי קדוש אלה הדברים אשר תדבר אל בני ישראל׃"));
hebsuperobject.biblemap.put("b2_19_7", new hebsuperobject(2,19,7,"ויבא משה ויקרא לזקני העם וישם לפניהם את כל הדברים האלה אשר צוהו יהוה׃"));
hebsuperobject.biblemap.put("b2_19_8", new hebsuperobject(2,19,8,"ויענו כל העם יחדו ויאמרו כל אשר דבר יהוה נעשה וישב משה את דברי העם אל יהוה׃"));
hebsuperobject.biblemap.put("b2_19_9", new hebsuperobject(2,19,9,"ויאמר יהוה אל משה הנה אנכי בא אליך בעב הענן בעבור ישמע העם בדברי עמך וגם בך יאמינו לעולם ויגד משה את דברי העם אל יהוה׃"));
hebsuperobject.biblemap.put("b2_19_10", new hebsuperobject(2,19,10,"ויאמר יהוה אל משה לך אל העם וקדשתם היום ומחר וכבסו שמלתם׃"));
hebsuperobject.biblemap.put("b2_19_11", new hebsuperobject(2,19,11,"והיו נכנים ליום השלישי כי ביום השלישי ירד יהוה לעיני כל העם על הר סיני׃"));
hebsuperobject.biblemap.put("b2_19_12", new hebsuperobject(2,19,12,"והגבלת את העם סביב לאמר השמרו לכם עלות בהר ונגע בקצהו כל הנגע בהר מות יומת׃"));
hebsuperobject.biblemap.put("b2_19_13", new hebsuperobject(2,19,13,"לא תגע בו יד כי סקול יסקל או ירה יירה אם בהמה אם איש לא יחיה במשך היבל המה יעלו בהר׃"));
hebsuperobject.biblemap.put("b2_19_14", new hebsuperobject(2,19,14,"וירד משה מן ההר אל העם ויקדש את העם ויכבסו שמלתם׃"));
hebsuperobject.biblemap.put("b2_19_15", new hebsuperobject(2,19,15,"ויאמר אל העם היו נכנים לשלשת ימים אל תגשו אל אשה׃"));
hebsuperobject.biblemap.put("b2_19_16", new hebsuperobject(2,19,16,"ויהי ביום השלישי בהית הבקר ויהי קלת וברקים וענן כבד על ההר וקל שפר חזק מאד ויחרד כל העם אשר במחנה׃"));
hebsuperobject.biblemap.put("b2_19_17", new hebsuperobject(2,19,17,"ויוצא משה את העם לקראת האלהים מן המחנה ויתיצבו בתחתית ההר׃"));
hebsuperobject.biblemap.put("b2_19_18", new hebsuperobject(2,19,18,"והר סיני עשן כלו מפני אשר ירד עליו יהוה באש ויעל עשנו כעשן הכבשן ויחרד כל ההר מאד׃"));
hebsuperobject.biblemap.put("b2_19_19", new hebsuperobject(2,19,19,"ויהי קול השופר הולך וחזק מאד משה ידבר והאלהים יעננו בקול׃"));
hebsuperobject.biblemap.put("b2_19_20", new hebsuperobject(2,19,20,"וירד יהוה על הר סיני אל ראש ההר ויקרא יהוה למשה אל ראש ההר ויעל משה׃"));
hebsuperobject.biblemap.put("b2_19_21", new hebsuperobject(2,19,21,"ויאמר יהוה אל משה רד העד בעם פן יהרסו אל יהוה לראות ונפל ממנו רב׃"));
hebsuperobject.biblemap.put("b2_19_22", new hebsuperobject(2,19,22,"וגם הכהנים הנגשים אל יהוה יתקדשו פן יפרץ בהם יהוה׃"));
hebsuperobject.biblemap.put("b2_19_23", new hebsuperobject(2,19,23,"ויאמר משה אל יהוה לא יוכל העם לעלת אל הר סיני כי אתה העדתה בנו לאמר הגבל את ההר וקדשתו׃"));
hebsuperobject.biblemap.put("b2_19_24", new hebsuperobject(2,19,24,"ויאמר אליו יהוה לך רד ועלית אתה ואהרן עמך והכהנים והעם אל יהרסו לעלת אל יהוה פן יפרץ בם׃"));
hebsuperobject.biblemap.put("b2_19_25", new hebsuperobject(2,19,25,"וירד משה אל העם ויאמר אלהם׃"));
hebsuperobject.biblemap.put("b2_20_1", new hebsuperobject(2,20,1,"וידבר אלהים את כל הדברים האלה לאמר׃"));
hebsuperobject.biblemap.put("b2_20_2", new hebsuperobject(2,20,2,"אנכי יהוה אלהיך אשר הוצאתיך מארץ מצרים מבית עבדים׃"));
hebsuperobject.biblemap.put("b2_20_3", new hebsuperobject(2,20,3,"לא יהיה לך אלהים אחרים על פני׃"));
hebsuperobject.biblemap.put("b2_20_4", new hebsuperobject(2,20,4,"לא תעשה לך פסל וכל תמונה אשר בשמים ממעל ואשר בארץ מתחת ואשר במים מתחת לארץ׃"));
hebsuperobject.biblemap.put("b2_20_5", new hebsuperobject(2,20,5,"לא תשתחוה להם ולא תעבדם כי אנכי יהוה אלהיך אל קנא פקד עון אבת על בנים על שלשים ועל רבעים לשנאי׃"));
hebsuperobject.biblemap.put("b2_20_6", new hebsuperobject(2,20,6,"ועשה חסד לאלפים לאהבי ולשמרי מצותי׃"));
hebsuperobject.biblemap.put("b2_20_7", new hebsuperobject(2,20,7,"לא תשא את שם יהוה אלהיך לשוא כי לא ינקה יהוה את אשר ישא את שמו לשוא׃"));
hebsuperobject.biblemap.put("b2_20_8", new hebsuperobject(2,20,8,"זכור את יום השבת לקדשו׃"));
hebsuperobject.biblemap.put("b2_20_9", new hebsuperobject(2,20,9,"ששת ימים תעבד ועשית כל מלאכתך׃"));
hebsuperobject.biblemap.put("b2_20_10", new hebsuperobject(2,20,10,"ויום השביעי שבת ליהוה אלהיך לא תעשה כל מלאכה אתה ובנך ובתך עבדך ואמתך ובהמתך וגרך אשר בשעריך׃"));
hebsuperobject.biblemap.put("b2_20_11", new hebsuperobject(2,20,11,"כי ששת ימים עשה יהוה את השמים ואת הארץ את הים ואת כל אשר בם וינח ביום השביעי על כן ברך יהוה את יום השבת ויקדשהו׃"));
hebsuperobject.biblemap.put("b2_20_12", new hebsuperobject(2,20,12,"כבד את אביך ואת אמך למען יארכון ימיך על האדמה אשר יהוה אלהיך נתן לך׃"));
hebsuperobject.biblemap.put("b2_20_13", new hebsuperobject(2,20,13,"לא תרצח׃"));
hebsuperobject.biblemap.put("b2_20_14", new hebsuperobject(2,20,14,"לא תנאף׃"));
hebsuperobject.biblemap.put("b2_20_15", new hebsuperobject(2,20,15,"לא תגנב׃"));
hebsuperobject.biblemap.put("b2_20_16", new hebsuperobject(2,20,16,"לא תענה ברעך עד שקר׃"));
hebsuperobject.biblemap.put("b2_20_17", new hebsuperobject(2,20,17,"לא תחמד בית רעך לא תחמד אשת רעך ועבדו ואמתו ושורו וחמרו וכל אשר לרעך׃"));
hebsuperobject.biblemap.put("b2_20_18", new hebsuperobject(2,20,18,"וכל העם ראים את הקולת ואת הלפידם ואת קול השפר ואת ההר עשן וירא העם וינעו ויעמדו מרחק׃"));
hebsuperobject.biblemap.put("b2_20_19", new hebsuperobject(2,20,19,"ויאמרו אל משה דבר אתה עמנו ונשמעה ואל ידבר עמנו אלהים פן נמות׃"));
hebsuperobject.biblemap.put("b2_20_20", new hebsuperobject(2,20,20,"ויאמר משה אל העם אל תיראו כי לבעבור נסות אתכם בא האלהים ובעבור תהיה יראתו על פניכם לבלתי תחטאו׃"));
hebsuperobject.biblemap.put("b2_20_21", new hebsuperobject(2,20,21,"ויעמד העם מרחק ומשה נגש אל הערפל אשר שם האלהים׃"));
hebsuperobject.biblemap.put("b2_20_22", new hebsuperobject(2,20,22,"ויאמר יהוה אל משה כה תאמר אל בני ישראל אתם ראיתם כי מן השמים דברתי עמכם׃"));
hebsuperobject.biblemap.put("b2_20_23", new hebsuperobject(2,20,23,"לא תעשון אתי אלהי כסף ואלהי זהב לא תעשו לכם׃"));
hebsuperobject.biblemap.put("b2_20_24", new hebsuperobject(2,20,24,"מזבח אדמה תעשה לי וזבחת עליו את עלתיך ואת שלמיך את צאנך ואת בקרך בכל המקום אשר אזכיר את שמי אבוא אליך וברכתיך׃"));
hebsuperobject.biblemap.put("b2_20_25", new hebsuperobject(2,20,25,"ואם מזבח אבנים תעשה לי לא תבנה אתהן גזית כי חרבך הנפת עליה ותחללה׃"));
hebsuperobject.biblemap.put("b2_20_26", new hebsuperobject(2,20,26,"ולא תעלה במעלת על מזבחי אשר לא תגלה ערותך עליו׃"));
hebsuperobject.biblemap.put("b2_21_1", new hebsuperobject(2,21,1,"ואלה המשפטים אשר תשים לפניהם׃"));
hebsuperobject.biblemap.put("b2_21_2", new hebsuperobject(2,21,2,"כי תקנה עבד עברי שש שנים יעבד ובשבעת יצא לחפשי חנם׃"));
hebsuperobject.biblemap.put("b2_21_3", new hebsuperobject(2,21,3,"אם בגפו יבא בגפו יצא אם בעל אשה הוא ויצאה אשתו עמו׃"));
hebsuperobject.biblemap.put("b2_21_4", new hebsuperobject(2,21,4,"אם אדניו יתן לו אשה וילדה לו בנים או בנות האשה וילדיה תהיה לאדניה והוא יצא בגפו׃"));
hebsuperobject.biblemap.put("b2_21_5", new hebsuperobject(2,21,5,"ואם אמר יאמר העבד אהבתי את אדני את אשתי ואת בני לא אצא חפשי׃"));
hebsuperobject.biblemap.put("b2_21_6", new hebsuperobject(2,21,6,"והגישו אדניו אל האלהים והגישו אל הדלת או אל המזוזה ורצע אדניו את אזנו במרצע ועבדו לעלם׃"));
hebsuperobject.biblemap.put("b2_21_7", new hebsuperobject(2,21,7,"וכי ימכר איש את בתו לאמה לא תצא כצאת העבדים׃"));
hebsuperobject.biblemap.put("b2_21_8", new hebsuperobject(2,21,8,"אם רעה בעיני אדניה אשר לא יעדה והפדה לעם נכרי לא ימשל למכרה בבגדו בה׃"));
hebsuperobject.biblemap.put("b2_21_9", new hebsuperobject(2,21,9,"ואם לבנו ייעדנה כמשפט הבנות יעשה לה׃"));
hebsuperobject.biblemap.put("b2_21_10", new hebsuperobject(2,21,10,"אם אחרת יקח לו שארה כסותה וענתה לא יגרע׃"));
hebsuperobject.biblemap.put("b2_21_11", new hebsuperobject(2,21,11,"ואם שלש אלה לא יעשה לה ויצאה חנם אין כסף׃"));
hebsuperobject.biblemap.put("b2_21_12", new hebsuperobject(2,21,12,"מכה איש ומת מות יומת׃"));
hebsuperobject.biblemap.put("b2_21_13", new hebsuperobject(2,21,13,"ואשר לא צדה והאלהים אנה לידו ושמתי לך מקום אשר ינוס שמה׃"));
hebsuperobject.biblemap.put("b2_21_14", new hebsuperobject(2,21,14,"וכי יזד איש על רעהו להרגו בערמה מעם מזבחי תקחנו למות׃"));
hebsuperobject.biblemap.put("b2_21_15", new hebsuperobject(2,21,15,"ומכה אביו ואמו מות יומת׃"));
hebsuperobject.biblemap.put("b2_21_16", new hebsuperobject(2,21,16,"וגנב איש ומכרו ונמצא בידו מות יומת׃"));
hebsuperobject.biblemap.put("b2_21_17", new hebsuperobject(2,21,17,"ומקלל אביו ואמו מות יומת׃"));
hebsuperobject.biblemap.put("b2_21_18", new hebsuperobject(2,21,18,"וכי יריבן אנשים והכה איש את רעהו באבן או באגרף ולא ימות ונפל למשכב׃"));
hebsuperobject.biblemap.put("b2_21_19", new hebsuperobject(2,21,19,"אם יקום והתהלך בחוץ על משענתו ונקה המכה רק שבתו יתן ורפא ירפא׃"));
hebsuperobject.biblemap.put("b2_21_20", new hebsuperobject(2,21,20,"וכי יכה איש את עבדו או את אמתו בשבט ומת תחת ידו נקם ינקם׃"));
hebsuperobject.biblemap.put("b2_21_21", new hebsuperobject(2,21,21,"אך אם יום או יומים יעמד לא יקם כי כספו הוא׃"));
hebsuperobject.biblemap.put("b2_21_22", new hebsuperobject(2,21,22,"וכי ינצו אנשים ונגפו אשה הרה ויצאו ילדיה ולא יהיה אסון ענוש יענש כאשר ישית עליו בעל האשה ונתן בפללים׃"));
hebsuperobject.biblemap.put("b2_21_23", new hebsuperobject(2,21,23,"ואם אסון יהיה ונתתה נפש תחת נפש׃"));
hebsuperobject.biblemap.put("b2_21_24", new hebsuperobject(2,21,24,"עין תחת עין שן תחת שן יד תחת יד רגל תחת רגל׃"));
hebsuperobject.biblemap.put("b2_21_25", new hebsuperobject(2,21,25,"כויה תחת כויה פצע תחת פצע חבורה תחת חבורה׃"));
hebsuperobject.biblemap.put("b2_21_26", new hebsuperobject(2,21,26,"וכי יכה איש את עין עבדו או את עין אמתו ושחתה לחפשי ישלחנו תחת עינו׃"));
hebsuperobject.biblemap.put("b2_21_27", new hebsuperobject(2,21,27,"ואם שן עבדו או שן אמתו יפיל לחפשי ישלחנו תחת שנו׃"));
hebsuperobject.biblemap.put("b2_21_28", new hebsuperobject(2,21,28,"וכי יגח שור את איש או את אשה ומת סקול יסקל השור ולא יאכל את בשרו ובעל השור נקי׃"));
hebsuperobject.biblemap.put("b2_21_29", new hebsuperobject(2,21,29,"ואם שור נגח הוא מתמל שלשם והועד בבעליו ולא ישמרנו והמית איש או אשה השור יסקל וגם בעליו יומת׃"));
hebsuperobject.biblemap.put("b2_21_30", new hebsuperobject(2,21,30,"אם כפר יושת עליו ונתן פדין נפשו ככל אשר יושת עליו׃"));
hebsuperobject.biblemap.put("b2_21_31", new hebsuperobject(2,21,31,"או בן יגח או בת יגח כמשפט הזה יעשה לו׃"));
hebsuperobject.biblemap.put("b2_21_32", new hebsuperobject(2,21,32,"אם עבד יגח השור או אמה כסף שלשים שקלים יתן לאדניו והשור יסקל׃"));
hebsuperobject.biblemap.put("b2_21_33", new hebsuperobject(2,21,33,"וכי יפתח איש בור או כי יכרה איש בר ולא יכסנו ונפל שמה שור או חמור׃"));
hebsuperobject.biblemap.put("b2_21_34", new hebsuperobject(2,21,34,"בעל הבור ישלם כסף ישיב לבעליו והמת יהיה לו׃"));
hebsuperobject.biblemap.put("b2_21_35", new hebsuperobject(2,21,35,"וכי יגף שור איש את שור רעהו ומת ומכרו את השור החי וחצו את כספו וגם את המת יחצון׃"));
hebsuperobject.biblemap.put("b2_21_36", new hebsuperobject(2,21,36,"או נודע כי שור נגח הוא מתמול שלשם ולא ישמרנו בעליו שלם ישלם שור תחת השור והמת יהיה לו׃"));
hebsuperobject.biblemap.put("b2_22_1", new hebsuperobject(2,22,1,"כי יגנב איש שור או שה וטבחו או מכרו חמשה בקר ישלם תחת השור וארבע צאן תחת השה׃"));
hebsuperobject.biblemap.put("b2_22_2", new hebsuperobject(2,22,2,"אם במחתרת ימצא הגנב והכה ומת אין לו דמים׃"));
hebsuperobject.biblemap.put("b2_22_3", new hebsuperobject(2,22,3,"אם זרחה השמש עליו דמים לו שלם ישלם אם אין לו ונמכר בגנבתו׃"));
hebsuperobject.biblemap.put("b2_22_4", new hebsuperobject(2,22,4,"אם המצא תמצא בידו הגנבה משור עד חמור עד שה חיים שנים ישלם׃"));
hebsuperobject.biblemap.put("b2_22_5", new hebsuperobject(2,22,5,"כי יבער איש שדה או כרם ושלח את בעירה ובער בשדה אחר מיטב שדהו ומיטב כרמו ישלם׃"));
hebsuperobject.biblemap.put("b2_22_6", new hebsuperobject(2,22,6,"כי תצא אש ומצאה קצים ונאכל גדיש או הקמה או השדה שלם ישלם המבער את הבערה׃"));
hebsuperobject.biblemap.put("b2_22_7", new hebsuperobject(2,22,7,"כי יתן איש אל רעהו כסף או כלים לשמר וגנב מבית האיש אם ימצא הגנב ישלם שנים׃"));
