hebsuperobject.biblemap.put("b2_33_1", new hebsuperobject(2,33,1,"וידבר יהוה אל משה לך עלה מזה אתה והעם אשר העלית מארץ מצרים אל הארץ אשר נשבעתי לאברהם ליצחק וליעקב לאמר לזרעך אתננה׃"));
hebsuperobject.biblemap.put("b2_33_2", new hebsuperobject(2,33,2,"ושלחתי לפניך מלאך וגרשתי את הכנעני האמרי והחתי והפרזי החוי והיבוסי׃"));
hebsuperobject.biblemap.put("b2_33_3", new hebsuperobject(2,33,3,"אל ארץ זבת חלב ודבש כי לא אעלה בקרבך כי עם קשה ערף אתה פן אכלך בדרך׃"));
hebsuperobject.biblemap.put("b2_33_4", new hebsuperobject(2,33,4,"וישמע העם את הדבר הרע הזה ויתאבלו ולא שתו איש עדיו עליו׃"));
hebsuperobject.biblemap.put("b2_33_5", new hebsuperobject(2,33,5,"ויאמר יהוה אל משה אמר אל בני ישראל אתם עם קשה ערף רגע אחד אעלה בקרבך וכליתיך ועתה הורד עדיך מעליך ואדעה מה אעשה לך׃"));
hebsuperobject.biblemap.put("b2_33_6", new hebsuperobject(2,33,6,"ויתנצלו בני ישראל את עדים מהר חורב׃"));
hebsuperobject.biblemap.put("b2_33_7", new hebsuperobject(2,33,7,"ומשה יקח את האהל ונטה לו מחוץ למחנה הרחק מן המחנה וקרא לו אהל מועד והיה כל מבקש יהוה יצא אל אהל מועד אשר מחוץ למחנה׃"));
hebsuperobject.biblemap.put("b2_33_8", new hebsuperobject(2,33,8,"והיה כצאת משה אל האהל יקומו כל העם ונצבו איש פתח אהלו והביטו אחרי משה עד באו האהלה׃"));
hebsuperobject.biblemap.put("b2_33_9", new hebsuperobject(2,33,9,"והיה כבא משה האהלה ירד עמוד הענן ועמד פתח האהל ודבר עם משה׃"));
hebsuperobject.biblemap.put("b2_33_10", new hebsuperobject(2,33,10,"וראה כל העם את עמוד הענן עמד פתח האהל וקם כל העם והשתחוו איש פתח אהלו׃"));
hebsuperobject.biblemap.put("b2_33_11", new hebsuperobject(2,33,11,"ודבר יהוה אל משה פנים אל פנים כאשר ידבר איש אל רעהו ושב אל המחנה ומשרתו יהושע בן נון נער לא ימיש מתוך האהל׃"));
hebsuperobject.biblemap.put("b2_33_12", new hebsuperobject(2,33,12,"ויאמר משה אל יהוה ראה אתה אמר אלי העל את העם הזה ואתה לא הודעתני את אשר תשלח עמי ואתה אמרת ידעתיך בשם וגם מצאת חן בעיני׃"));
hebsuperobject.biblemap.put("b2_33_13", new hebsuperobject(2,33,13,"ועתה אם נא מצאתי חן בעיניך הודעני נא את דרכך ואדעך למען אמצא חן בעיניך וראה כי עמך הגוי הזה׃"));
hebsuperobject.biblemap.put("b2_33_14", new hebsuperobject(2,33,14,"ויאמר פני ילכו והנחתי לך׃"));
hebsuperobject.biblemap.put("b2_33_15", new hebsuperobject(2,33,15,"ויאמר אליו אם אין פניך הלכים אל תעלנו מזה׃"));
hebsuperobject.biblemap.put("b2_33_16", new hebsuperobject(2,33,16,"ובמה יודע אפוא כי מצאתי חן בעיניך אני ועמך הלוא בלכתך עמנו ונפלינו אני ועמך מכל העם אשר על פני האדמה׃"));
hebsuperobject.biblemap.put("b2_33_17", new hebsuperobject(2,33,17,"ויאמר יהוה אל משה גם את הדבר הזה אשר דברת אעשה כי מצאת חן בעיני ואדעך בשם׃"));
hebsuperobject.biblemap.put("b2_33_18", new hebsuperobject(2,33,18,"ויאמר הראני נא את כבדך׃"));
hebsuperobject.biblemap.put("b2_33_19", new hebsuperobject(2,33,19,"ויאמר אני אעביר כל טובי על פניך וקראתי בשם יהוה לפניך וחנתי את אשר אחן ורחמתי את אשר ארחם׃"));
hebsuperobject.biblemap.put("b2_33_20", new hebsuperobject(2,33,20,"ויאמר לא תוכל לראת את פני כי לא יראני האדם וחי׃"));
hebsuperobject.biblemap.put("b2_33_21", new hebsuperobject(2,33,21,"ויאמר יהוה הנה מקום אתי ונצבת על הצור׃"));
hebsuperobject.biblemap.put("b2_33_22", new hebsuperobject(2,33,22,"והיה בעבר כבדי ושמתיך בנקרת הצור ושכתי כפי עליך עד עברי׃"));
hebsuperobject.biblemap.put("b2_33_23", new hebsuperobject(2,33,23,"והסרתי את כפי וראית את אחרי ופני לא יראו׃"));
hebsuperobject.biblemap.put("b2_34_1", new hebsuperobject(2,34,1,"ויאמר יהוה אל משה פסל לך שני לחת אבנים כראשנים וכתבתי על הלחת את הדברים אשר היו על הלחת הראשנים אשר שברת׃"));
hebsuperobject.biblemap.put("b2_34_2", new hebsuperobject(2,34,2,"והיה נכון לבקר ועלית בבקר אל הר סיני ונצבת לי שם על ראש ההר׃"));
hebsuperobject.biblemap.put("b2_34_3", new hebsuperobject(2,34,3,"ואיש לא יעלה עמך וגם איש אל ירא בכל ההר גם הצאן והבקר אל ירעו אל מול ההר ההוא׃"));
hebsuperobject.biblemap.put("b2_34_4", new hebsuperobject(2,34,4,"ויפסל שני לחת אבנים כראשנים וישכם משה בבקר ויעל אל הר סיני כאשר צוה יהוה אתו ויקח בידו שני לחת אבנים׃"));
hebsuperobject.biblemap.put("b2_34_5", new hebsuperobject(2,34,5,"וירד יהוה בענן ויתיצב עמו שם ויקרא בשם יהוה׃"));
hebsuperobject.biblemap.put("b2_34_6", new hebsuperobject(2,34,6,"ויעבר יהוה על פניו ויקרא יהוה יהוה אל רחום וחנון ארך אפים ורב חסד ואמת׃"));
hebsuperobject.biblemap.put("b2_34_7", new hebsuperobject(2,34,7,"נצר חסד לאלפים נשא עון ופשע וחטאה ונקה לא ינקה פקד עון אבות על בנים ועל בני בנים על שלשים ועל רבעים׃"));
hebsuperobject.biblemap.put("b2_34_8", new hebsuperobject(2,34,8,"וימהר משה ויקד ארצה וישתחו׃"));
hebsuperobject.biblemap.put("b2_34_9", new hebsuperobject(2,34,9,"ויאמר אם נא מצאתי חן בעיניך אדני ילך נא אדני בקרבנו כי עם קשה ערף הוא וסלחת לעוננו ולחטאתנו ונחלתנו׃"));
hebsuperobject.biblemap.put("b2_34_10", new hebsuperobject(2,34,10,"ויאמר הנה אנכי כרת ברית נגד כל עמך אעשה נפלאת אשר לא נבראו בכל הארץ ובכל הגוים וראה כל העם אשר אתה בקרבו את מעשה יהוה כי נורא הוא אשר אני עשה עמך׃"));
hebsuperobject.biblemap.put("b2_34_11", new hebsuperobject(2,34,11,"שמר לך את אשר אנכי מצוך היום הנני גרש מפניך את האמרי והכנעני והחתי והפרזי והחוי והיבוסי׃"));
hebsuperobject.biblemap.put("b2_34_12", new hebsuperobject(2,34,12,"השמר לך פן תכרת ברית ליושב הארץ אשר אתה בא עליה פן יהיה למוקש בקרבך׃"));
hebsuperobject.biblemap.put("b2_34_13", new hebsuperobject(2,34,13,"כי את מזבחתם תתצון ואת מצבתם תשברון ואת אשריו תכרתון׃"));
hebsuperobject.biblemap.put("b2_34_14", new hebsuperobject(2,34,14,"כי לא תשתחוה לאל אחר כי יהוה קנא שמו אל קנא הוא׃"));
hebsuperobject.biblemap.put("b2_34_15", new hebsuperobject(2,34,15,"פן תכרת ברית ליושב הארץ וזנו אחרי אלהיהם וזבחו לאלהיהם וקרא לך ואכלת מזבחו׃"));
hebsuperobject.biblemap.put("b2_34_16", new hebsuperobject(2,34,16,"ולקחת מבנתיו לבניך וזנו בנתיו אחרי אלהיהן והזנו את בניך אחרי אלהיהן׃"));
hebsuperobject.biblemap.put("b2_34_17", new hebsuperobject(2,34,17,"אלהי מסכה לא תעשה לך׃"));
hebsuperobject.biblemap.put("b2_34_18", new hebsuperobject(2,34,18,"את חג המצות תשמר שבעת ימים תאכל מצות אשר צויתך למועד חדש האביב כי בחדש האביב יצאת ממצרים׃"));
hebsuperobject.biblemap.put("b2_34_19", new hebsuperobject(2,34,19,"כל פטר רחם לי וכל מקנך תזכר פטר שור ושה׃"));
hebsuperobject.biblemap.put("b2_34_20", new hebsuperobject(2,34,20,"ופטר חמור תפדה בשה ואם לא תפדה וערפתו כל בכור בניך תפדה ולא יראו פני ריקם׃"));
hebsuperobject.biblemap.put("b2_34_21", new hebsuperobject(2,34,21,"ששת ימים תעבד וביום השביעי תשבת בחריש ובקציר תשבת׃"));
hebsuperobject.biblemap.put("b2_34_22", new hebsuperobject(2,34,22,"וחג שבעת תעשה לך בכורי קציר חטים וחג האסיף תקופת השנה׃"));
hebsuperobject.biblemap.put("b2_34_23", new hebsuperobject(2,34,23,"שלש פעמים בשנה יראה כל זכורך את פני האדן יהוה אלהי ישראל׃"));
hebsuperobject.biblemap.put("b2_34_24", new hebsuperobject(2,34,24,"כי אוריש גוים מפניך והרחבתי את גבולך ולא יחמד איש את ארצך בעלתך לראות את פני יהוה אלהיך שלש פעמים בשנה׃"));
hebsuperobject.biblemap.put("b2_34_25", new hebsuperobject(2,34,25,"לא תשחט על חמץ דם זבחי ולא ילין לבקר זבח חג הפסח׃"));
hebsuperobject.biblemap.put("b2_34_26", new hebsuperobject(2,34,26,"ראשית בכורי אדמתך תביא בית יהוה אלהיך לא תבשל גדי בחלב אמו׃"));
hebsuperobject.biblemap.put("b2_34_27", new hebsuperobject(2,34,27,"ויאמר יהוה אל משה כתב לך את הדברים האלה כי על פי הדברים האלה כרתי אתך ברית ואת ישראל׃"));
hebsuperobject.biblemap.put("b2_34_28", new hebsuperobject(2,34,28,"ויהי שם עם יהוה ארבעים יום וארבעים לילה לחם לא אכל ומים לא שתה ויכתב על הלחת את דברי הברית עשרת הדברים׃"));
hebsuperobject.biblemap.put("b2_34_29", new hebsuperobject(2,34,29,"ויהי ברדת משה מהר סיני ושני לחת העדת ביד משה ברדתו מן ההר ומשה לא ידע כי קרן עור פניו בדברו אתו׃"));
hebsuperobject.biblemap.put("b2_34_30", new hebsuperobject(2,34,30,"וירא אהרן וכל בני ישראל את משה והנה קרן עור פניו וייראו מגשת אליו׃"));
hebsuperobject.biblemap.put("b2_34_31", new hebsuperobject(2,34,31,"ויקרא אלהם משה וישבו אליו אהרן וכל הנשאים בעדה וידבר משה אלהם׃"));
hebsuperobject.biblemap.put("b2_34_32", new hebsuperobject(2,34,32,"ואחרי כן נגשו כל בני ישראל ויצום את כל אשר דבר יהוה אתו בהר סיני׃"));
hebsuperobject.biblemap.put("b2_34_33", new hebsuperobject(2,34,33,"ויכל משה מדבר אתם ויתן על פניו מסוה׃"));
hebsuperobject.biblemap.put("b2_34_34", new hebsuperobject(2,34,34,"ובבא משה לפני יהוה לדבר אתו יסיר את המסוה עד צאתו ויצא ודבר אל בני ישראל את אשר יצוה׃"));
hebsuperobject.biblemap.put("b2_34_35", new hebsuperobject(2,34,35,"וראו בני ישראל את פני משה כי קרן עור פני משה והשיב משה את המסוה על פניו עד באו לדבר אתו׃"));
hebsuperobject.biblemap.put("b2_35_1", new hebsuperobject(2,35,1,"ויקהל משה את כל עדת בני ישראל ויאמר אלהם אלה הדברים אשר צוה יהוה לעשת אתם׃"));
hebsuperobject.biblemap.put("b2_35_2", new hebsuperobject(2,35,2,"ששת ימים תעשה מלאכה וביום השביעי יהיה לכם קדש שבת שבתון ליהוה כל העשה בו מלאכה יומת׃"));
hebsuperobject.biblemap.put("b2_35_3", new hebsuperobject(2,35,3,"לא תבערו אש בכל משבתיכם ביום השבת׃"));
hebsuperobject.biblemap.put("b2_35_4", new hebsuperobject(2,35,4,"ויאמר משה אל כל עדת בני ישראל לאמר זה הדבר אשר צוה יהוה לאמר׃"));
hebsuperobject.biblemap.put("b2_35_5", new hebsuperobject(2,35,5,"קחו מאתכם תרומה ליהוה כל נדיב לבו יביאה את תרומת יהוה זהב וכסף ונחשת׃"));
hebsuperobject.biblemap.put("b2_35_6", new hebsuperobject(2,35,6,"ותכלת וארגמן ותולעת שני ושש ועזים׃"));
hebsuperobject.biblemap.put("b2_35_7", new hebsuperobject(2,35,7,"וערת אילם מאדמים וערת תחשים ועצי שטים׃"));
hebsuperobject.biblemap.put("b2_35_8", new hebsuperobject(2,35,8,"ושמן למאור ובשמים לשמן המשחה ולקטרת הסמים׃"));
hebsuperobject.biblemap.put("b2_35_9", new hebsuperobject(2,35,9,"ואבני שהם ואבני מלאים לאפוד ולחשן׃"));
hebsuperobject.biblemap.put("b2_35_10", new hebsuperobject(2,35,10,"וכל חכם לב בכם יבאו ויעשו את כל אשר צוה יהוה׃"));
hebsuperobject.biblemap.put("b2_35_11", new hebsuperobject(2,35,11,"את המשכן את אהלו ואת מכסהו את קרסיו ואת קרשיו את בריחו את עמדיו ואת אדניו׃"));
hebsuperobject.biblemap.put("b2_35_12", new hebsuperobject(2,35,12,"את הארן ואת בדיו את הכפרת ואת פרכת המסך׃"));
hebsuperobject.biblemap.put("b2_35_13", new hebsuperobject(2,35,13,"את השלחן ואת בדיו ואת כל כליו ואת לחם הפנים׃"));
hebsuperobject.biblemap.put("b2_35_14", new hebsuperobject(2,35,14,"ואת מנרת המאור ואת כליה ואת נרתיה ואת שמן המאור׃"));
hebsuperobject.biblemap.put("b2_35_15", new hebsuperobject(2,35,15,"ואת מזבח הקטרת ואת בדיו ואת שמן המשחה ואת קטרת הסמים ואת מסך הפתח לפתח המשכן׃"));
hebsuperobject.biblemap.put("b2_35_16", new hebsuperobject(2,35,16,"את מזבח העלה ואת מכבר הנחשת אשר לו את בדיו ואת כל כליו את הכיר ואת כנו׃"));
hebsuperobject.biblemap.put("b2_35_17", new hebsuperobject(2,35,17,"את קלעי החצר את עמדיו ואת אדניה ואת מסך שער החצר׃"));
hebsuperobject.biblemap.put("b2_35_18", new hebsuperobject(2,35,18,"את יתדת המשכן ואת יתדת החצר ואת מיתריהם׃"));
hebsuperobject.biblemap.put("b2_35_19", new hebsuperobject(2,35,19,"את בגדי השרד לשרת בקדש את בגדי הקדש לאהרן הכהן ואת בגדי בניו לכהן׃"));
hebsuperobject.biblemap.put("b2_35_20", new hebsuperobject(2,35,20,"ויצאו כל עדת בני ישראל מלפני משה׃"));
hebsuperobject.biblemap.put("b2_35_21", new hebsuperobject(2,35,21,"ויבאו כל איש אשר נשאו לבו וכל אשר נדבה רוחו אתו הביאו את תרומת יהוה למלאכת אהל מועד ולכל עבדתו ולבגדי הקדש׃"));
hebsuperobject.biblemap.put("b2_35_22", new hebsuperobject(2,35,22,"ויבאו האנשים על הנשים כל נדיב לב הביאו חח ונזם וטבעת וכומז כל כלי זהב וכל איש אשר הניף תנופת זהב ליהוה׃"));
hebsuperobject.biblemap.put("b2_35_23", new hebsuperobject(2,35,23,"וכל איש אשר נמצא אתו תכלת וארגמן ותולעת שני ושש ועזים וערת אילם מאדמים וערת תחשים הביאו׃"));
hebsuperobject.biblemap.put("b2_35_24", new hebsuperobject(2,35,24,"כל מרים תרומת כסף ונחשת הביאו את תרומת יהוה וכל אשר נמצא אתו עצי שטים לכל מלאכת העבדה הביאו׃"));
